import React, { Component } from "react";

export class Project extends Component {
  render() {
    let { name, languagesIcons, source, info, picture } = this.props.item;

    return (
      <div className="project">
        <div className="icons"></div>
        <h3>{name}</h3>
      </div>
    );
  }
}

export default Project;
